<!doctype html>
<html lang="en">
  <head>
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <link rel="shortcut icon" href="%PUBLIC_URL%/favicon.ico">
    <!--
      Notice the use of %PUBLIC_URL% in the tag above.
      It will be replaced with the URL of the `public` folder during the build.
      Only files inside the `public` folder can be referenced from the HTML.

      Unlike "/favicon.ico" or "favicon.ico", "%PUBLIC_URL%/favicon.ico" will
      work correctly both with client-side routing and a non-root public URL.
      Learn how to configure a non-root public URL by running `npm run build`.
    -->
    <title>KML</title>
  </head>
  <body>
    <p>
      <a href="/San_Francisco/San_Francisco.kml">San_Francisco</a>
    </p>
    <p>
      <a href="/San_Francisco/nikeshike.kml">nikeshike</a>
    </p>
    <p>
      <a href="/Half_Moon_Bay/Half_Moon_Bay.kml">Half_Moon_Bay</a>
    </p>
    <p>
      <a href="/Half_Moon_Bay/kellyritz.kml">kellyritz</a>
    </p>
    <p>
      <a href="/Half_Moon_Bay/miramarkelly.kml">miramarkelly</a>
    </p>
    <p>
      <a href="/route.kml">route</a>
    </p>
    <p>
      <a href="/westcampus.kml">westcampus</a>
    </p>
    <p>
      <a href="/KML_Samples.kml">KML_Samples</a>
    <p>
  </body>
</html>
